"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[241],{1026:n=>{n.exports=JSON.parse('{"label":"motion-planning","permalink":"/tags/motion-planning","allTagsPath":"/tags","count":5,"items":[{"id":"learning/robotic-navigation-and-exploration/motion-planning/curve-interpolation-i","title":"Curve Interpolation I","description":"Curve Interpolation \u5c07\u6703\u7528\u4e00\u500b\u66f2\u7dda\u51fd\u6578\u9023\u63a5\u7bc0\u9ede\uff0c\u4f7f\u5f97\u8def\u5f91\u8b8a\u5f97\u5e73\u6ed1\u3002 \u9019\u500b\u7ae0\u7bc0\u6703\u4ecb\u7d39\u5e7e\u7a2e\u66f2\u7dda\u51fd\u6578\uff0c\u4f8b\u5982 Explicit\u3001Implicit \u548c Parametric\uff0c\u4e26\u91dd\u5c0d Parametric Cubic Polynomial Curves \u548c Cubic Interpolating Curves \u9032\u884c\u4e86\u6df1\u5165\u89e3\u91cb\u3002","permalink":"/learning/robotic-navigation-and-exploration/motion-planning/curve-interpolation-i"},{"id":"learning/robotic-navigation-and-exploration/motion-planning/curve-interpolation-ii","title":"Curve Interpolation II","description":"\u672c\u6587\u63a2\u8a0e\u4e86\u4e09\u7a2e\u4e0d\u540c\u7684\u66f2\u7dda\u63d2\u503c\u6280\u8853\uff0c\u5206\u5225\u662f Hermite Curves\u3001Bezier Curves \u548c Cubic B-spline Curves\uff0c\u5b83\u5011\u90fd\u53ef\u4ee5\u4f7f\u7528\u63a7\u5236\u9ede\u4f86\u7522\u751f\u51fa\u66f2\u7dda\uff0c\u4f46\u672c\u6587\u7a81\u51fa\u4e86 Cubic B-spline Curves \u7684\u512a\u9ede\uff0c\u5b83\u53ef\u4ee5\u8b93\u5169\u500b\u5340\u6bb5\u5728\u63a5\u9ede\u8655\uff0c\u4e00\u968e\u5fae\u5206\u7684\u503c\u662f\u76f8\u540c\u7684\uff0c\u751a\u81f3\u53ef\u4ee5\u6eff\u8db3\u63a5\u9ede\u8655\u7684\u4e8c\u968e\u5fae\u5206\u4e5f\u76f8\u540c\uff0c\u70ba\u4e86\u66f4\u52a0\u5e73\u6ed1\u7684\u66f2\u7dda\u3002","permalink":"/learning/robotic-navigation-and-exploration/motion-planning/curve-interpolation-ii"},{"id":"learning/robotic-navigation-and-exploration/motion-planning/introduction","title":"Introduction","description":"Motion planning \u662f\u4e00\u7a2e\u89e3\u6c7a\u79fb\u52d5\u554f\u984c\u7684\u6280\u8853\uff0c\u5b83\u5fd7\u5728\u627e\u51fa\u4e00\u9023\u4e32\u52d5\u4f5c\u5e8f\u5217\uff0c\u8b93\u8eca\u5b50\u79fb\u52d5\u5230\u7d42\u9ede\uff0c\u8981\u6c42\u52d5\u4f5c\u5e8f\u5217\u9700\u8981\u907f\u514d\u649e\u5230\u969c\u7919\u7269\u3001\u52d5\u4f5c\u9650\u5236\uff08\u5982\u6700\u5927\u901f\u5ea6\u7b49\uff09\u3001\u79fb\u52d5\u8def\u5f91\u9700\u8981\u5e73\u6ed1\u4ee5\u53ca\u6700\u77ed\u8def\u5f91\u3002Motion planning \u53ef\u4ee5\u5206\u6210\u4e09\u90e8\u5206\uff1aPath Planning\u3001Curve Interpolation \u548c Trajectory Planning\u3002","permalink":"/learning/robotic-navigation-and-exploration/motion-planning/introduction"},{"id":"learning/robotic-navigation-and-exploration/motion-planning/path-planning","title":"Path Planning","description":"\u672c\u6587\u4ecb\u7d39 Path Planning\uff0c\u5b83\u662f\u70ba\u4e86\u8b93\u6a5f\u5668\u4eba\u77e5\u9053\u5982\u4f55\u5f9e\u4e00\u500b\u8d77\u9ede\u5230\u9054\u53e6\u4e00\u500b\u7d42\u9ede\u7684\u7b56\u7565\u3002\u5b83\u8b93\u6211\u5011\u53ef\u4ee5\u7528 Graph G \u4f86\u8868\u793a\u5730\u5716\uff0c\u5176\u4e2d G = (V, E)\uff0cV \u662f\u4e00\u7d44\u9ede\uff0cE \u662f\u4e00\u7d44\u908a\u3002\u800c\u53e6\u5916\u4e5f\u6703\u6709 weights \u4f86\u6c42\u89e3 single-source shortest path\uff0c\u5373\u7d66\u5b9a\u8d77\u9ede\u7684\u6700\u77ed\u8def\u5f91\u3002","permalink":"/learning/robotic-navigation-and-exploration/motion-planning/path-planning"},{"id":"learning/robotic-navigation-and-exploration/motion-planning/trajectory-planning","title":"Trajectory Planning","description":"\u672c\u6587\u5c07\u63cf\u8ff0\u5982\u4f55\u4f7f\u7528 State lattice planning \u548c Frenet Coordinate \u4f86\u8a08\u7b97\u81ea\u99d5\u8eca\u7684\u8ecc\u8de1\u3002State lattice planning \u900f\u904e\u7d50\u5408\u7a7a\u9593\u548c\u6642\u9593\uff0c\u63a1\u6a23\u8ecc\u8de1\u4e26\u8a08\u7b97\u6210\u672c\uff0c\u518d\u6aa2\u67e5\u8ecc\u8de1\u662f\u5426\u53ef\u7528\uff0c\u4e26\u9078\u64c7\u6210\u672c\u6700\u4f4e\u7684\u8ecc\u8de1\u3002Frenet Coordinate \u5c07\u8eca\u5b50\u4f4d\u7f6e\u6295\u5f71\u5230\u4e8c\u7dad\u8def\u5f91\uff0c\u6c42\u53d6\u4e00\u968e\u3001\u4e8c\u968e\u5fae\u5206\u548c\u6700\u4f4e\u6210\u672c\u3002\u6700\u5f8c\uff0cTrajectory Planning \u8003\u616e\u52d5\u614b\u969c\u7919\u7269\uff0c\u8a08\u7b97\u6bcf\u500b\u6642\u9593\u9ede\u7684\u904b\u52d5\u8cc7\u8a0a\uff0c\u627e\u51fa\u6700\u4f4e\u6210\u672c\u7684\u8ecc\u8de1\u3002","permalink":"/learning/robotic-navigation-and-exploration/motion-planning/trajectory-planning"}]}')}}]);